import React from 'react'

export default function Button() {
    return (
        <div className="relative left-[1300px] w-[130px] h-12 ">
            <div className="absolute w-[130px] h-12 top-0 bg-[#0594ff] rounded-[15px] hover:bg-blue-500" />
            <a href='#' className="absolute left-[24px] top-[16px] text-center 
            text-white text-sm font-bold font-['Helvetica']">
                Get in touch
            </a>
        </div>
    )
}
